const font = () => {
    document.write('<style>');
    (function (n, d, s) {
        while (n > 0) d[--n] = s.charCodeAt(n);
        document.write("@font-face{font-family:'IranSans';font-weight:normal;font-style:normal;src:url('" + URL.createObjectURL(new Blob([d], {type: "application/x-font-ttf"})) + "')format('truetype');}\n");
    })(97736, new Uint8Array(97736), atob(""));
    document.write('</style>');
}

module.exports = font;